import React from "react";
import DeviceList from "../DeviceList";
import DeviceStatus from "./DeviceStatus";
import { css } from "@emotion/react";
import styled from "@emotion/styled";

const ParentContainer = styled.div`
  display: flex;
  justify-content: space-around;
  align-items: flex-start;
  flex-wrap: wrap;
  margin: 2rem;
  border: 5px solid red;
  min-width: 200px;
`;

const ChildContainer = styled.div`
  margin: 2rem;
  border: 5px solid red;
  background-color: #f5f5f5;
`;

function Dashboard() {
  return (
    <div
      css={css`
        display: flex;
        justify-content: space-around;
        align-items: flex-start;
        margin-top: 2rem;
        border: 5px solid red;
        background-color: #f5f5f5;
      `}
    >
      <ParentContainer>
        <ChildContainer>
          <DeviceList />
        </ChildContainer>
        <ChildContainer>
          <DeviceStatus />
        </ChildContainer>
        <ChildContainer>
          <DeviceList />
        </ChildContainer>
        <ChildContainer>
          <DeviceStatus />
        </ChildContainer>
        <ChildContainer>
          <DeviceList />
        </ChildContainer>
      </ParentContainer>
    </div>
  );
}

export default Dashboard;
